import { Link } from "react-router-dom";


function Navigation() {
    return (
        <div>
            <h1>My Life</h1>
            <nav>
                <ul>
                    <Link to="/">Home</Link>
                    <Link to="/Blog">Blog</Link>
                </ul>
            </nav>
        </div>
    );
}

export default Navigation;
